import 'bootstrap/dist/css/bootstrap.css';
import "../../../node_modules/bootstrap/dist/js/bootstrap.min.js";
import "bootstrap-icons/font/bootstrap-icons.css";
import '../../assets/css/App.css';
import  '../../assets/css/main.css';
import { Navbar } from "../../components/forHome/navbar";
import HomePageComplexButtons from "../../components/forHome/homePageComplexButtons";
import * as React from "react";
import OurBottomNavigation from "../../components/forHome/bottomNavigation";
import ContactUs from "../../components/forHome/contactUs";
import ReactWeather, { useOpenWeather } from 'react-open-weather';
import Grid from "@mui/material/Grid";
import {Carousel} from "react-bootstrap";
import Card from "@mui/material/Card";
import HomeMap from "../../components/forHome/homeMap";
import FollowUs from "../../components/forHome/followUs";

function Home() {
    const { data, isLoading, errorMessage } = useOpenWeather({
        key:  process.env.REACT_APP_WEATHER_API_KEY,
        lat: '44.227',
        lon: '17.661',
        lang: 'en',
        unit: 'metric',
    });
    const dataCarousel = [
        {
            image: "data:image/jpeg;base64,",
        },
        {
            image: "https://lh5.googleusercontent.com/p/AF1QipMWupru1VOBdpVO-My-YSMRcX-T2rP7UtDSCkUN=w540-h312-n-k-no",
        },
        {
            image: "https://lh5.googleusercontent.com/p/AF1QipPkjDIMiILaZN8jj8J5vEuubQLKPm8vqnR7GBC0=w540-h312-n-k-no",
        },
        {
            image: "https://encrypted-tbn0.gstatic.com/licensed-image?q=tbn:ANd9GcTNDIShBBec6k4tRSDMQapXmvha5zjY1eEu0ddTrV1SZdaGqG36XWqCzt3yvnLuUzCISuXdnYX2PT1sj4qhrZBpbRfcQEEkKJZVehvmxQ",
        }
    ];
    return (
        <>
            <header>
                <Navbar background={"dark"} page={"Home"}/>
                <div
                    id="intro"
                    className="bg-image"
                    style={{
                        backgroundImage: `url("https://t0.gstatic.com/licensed-image?q=tbn:ANd9GcRfMNsGMvu12v8RXqHSrD6FvM6jUk7cug0L3CFL0SOmrkR-avagMkoZKVrukLzKCDPx")`,
                        "height": "100vh"
                    }}
                >
                    <div className="mask text-white" style={{backgroundColor: "rgba(0, 0, 0, 0.8)"}}>
                        <div className="container d-flex align-items-center text-center h-100">
                            <div className="mx-auto">
                                <h3 className="mb-5" style={{ color: "rgba(255, 255, 255, 0.79)" }}>
                                    Travnik is not just a city, it's an experience that leaves an indelible mark on your soul!
                                </h3>
                                <HomePageComplexButtons/>
                            </div>
                        </div>
                    </div>
                </div>
            </header>
            <div>
            <Grid
                container fluid
                direction="row"
                justifyContent="start"
                alignItems="start"
                className={"mb-4"}
                spacing={4}
            >
                <Grid item xs={12} md={6} lg={4}>
                    <div className={"m-1"}>
                        <ReactWeather
                            isLoading={isLoading}
                            errorMessage={errorMessage}
                            data={data}
                            lang="en"
                            locationLabel="Travnik"
                            unitsLabels={{ temperature: 'C', windSpeed: 'Km/h' }}
                            showForecast
                        />
                    </div>
                </Grid>
                <Grid item xs={12} md={6} lg={4}>
                    <Card className={"m-1"}>
                        <HomeMap/>
                        <FollowUs/>
                    </Card>
                </Grid>
                <Grid item xs={12} md={6} lg={4}>
                    <Card className={"m-1 mb-2"}>
                        <Carousel>
                            {dataCarousel.map((el, index) => (
                                <Carousel.Item key={index} interval={3500}>
                                    <img src={el.image} alt={`Carousel Item ${index}`} />
                                    <Carousel.Caption>
                                        <h4>Travnik</h4>
                                    </Carousel.Caption>
                                </Carousel.Item>
                            ))}
                        </Carousel>
                        <ContactUs/>
                    </Card>
                </Grid>
            </Grid>
            </div>
            <div>
                <OurBottomNavigation/>
            </div>
        </>

    );
}

export default Home;